import React, { Component } from "react";


import { Table, Button, Form } from "react-bootstrap";

export default class BoardAdmin extends Component {
    constructor() {
        super();
        this.state = {
          courseApplications: [
            ["9/29/2019", "C++ Programming Course"],
            ["9/29/2019", "Self-help Course"],
            ["9/29/2019", "How to hack Monash network"],
          ],
          
        };
      }


    

      
      render() {
        return (
          <div>
            {/* Title */}
            <h1>Admin Approvals</h1>
    
            {/* Buttons */}
            <div>
              <Button href="adminApproval/courses">Course Approval</Button>
              <Button href="adminApproval/businesses">Business Approval</Button>
            </div>
          </div>
        );
      }
    
}
